import { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [users, setUsers] = useState([]);
  const getusers = async () => {
    const res = await fetch('https://api.pokemontcg.io/v2/cards?page=1&pageSize=10');
    const data = await res.json();
    console.log(data);
  }
  useEffect(() => {
    getusers();
  });
  return (
    <div className="App">

    </div>
  );
}

export default App;
